import { EditOutlined, MessageOutlined, SettingOutlined, HeartFilled } from '@ant-design/icons';
import { Avatar, Card, Skeleton } from 'antd';
import React from 'react';
const { Meta } = Card;

const PostCard = () => {
    return (
        <>
            <Card
                style={{ width: 500, marginTop: 16 }}
                actions={[
                    <SettingOutlined key="setting" />,
                    <EditOutlined key="edit" />,
                    <HeartFilled />,
                    <MessageOutlined />
                ]}
            >
                <Skeleton loading={false} avatar active>
                    <Meta
                        avatar={
                            <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
                        }
                        title="Card title"
                        description="It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. "
                    />
                </Skeleton>
            </Card>
            <Card bordered={false} style={{ width: 500 }}>
                <Input placeholder="Basic usage" key={Math.random()} suffix={<PlusOutlined onClick={() => { }} />} />
                <p>Card content</p>
                <p>Card content</p>
            </Card>
        </>
    );
}

export default PostCard;
